import * as serviceWorker from './serviceWorker';
import state, { subscribe } from './redux/state.js'
import React from 'react';
import ReactDOM from 'react-dom';
import s from './App.module.css';
import App from './App';
import {addData_bag, ubdateTodayTextarea} from './redux/state'

let render_Tree =(state)=>{
    ReactDOM.render(<App  data={state} addData_bag={addData_bag} ubdateTodayTextarea={ubdateTodayTextarea}/>, document.getElementById('root'));
}

render_Tree(state);
subscriberibe(render_Tree);

serviceWorker.unregister();
